window.bookSummaryJSON = "<p><b>She’ll pay the price for her betrayal…as my bride.</b> </p> <p>Elise Regazza is beautiful. </p> <p>She’s also a liar. </p> <p>A schemer. </p> <p>A woman who betrayed The Family. </p> <p>And she owes her life for what she’s done. </p> <p>When she begs for mercy, I offer her a single choice: Marry me. </p> <p>Solidify my power in The Family. </p> <p>And she agrees. </p> <p>But make no mistake, little Elise will never be free.</p> <p>Now our vows will be her shackles. </p> <p>My rules will be her collar. </p> <p>And disloyalty will not be tolerated. </p> <p>The traitor will learn to honor and obey the man she hates…</p> <p>For better or for worse.</p> <p>Until death do us part.</p>"; 
